import React from 'react';
import CircularText from './CircularText';
import RotatingText from './RotatingText';
import Squares from './Squares';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <h1 className="main-title">Buildathon</h1>
        <div className="circular-text-overlay">
          <CircularText
            text=" GENZ 5-9 QUIT CLUB "
            onHover="speedUp"
            spinDuration={20}
            className="custom-class"
          />
        </div>
      </div>

      <div className="mission-section">
        <Squares 
          speed={0.5} 
          squareSize={40}
          direction='diagonal'
          borderColor='#fff'
          hoverFillColor='#222'
          className="squares-background"
        />
        <div className="mission-wrapper">
          <h2 className="mission-title">Our Mission</h2>
          <div className="mission-content">
            <p className="mission-text">
              We believe in empowering the next generation of builders, creators, and visionaries. 
              Our platform connects passionate individuals who are ready to turn their ideas into reality.
            </p>

            <div className="rotating-text-section">
              <div className="text-line">
                <span className="label">for</span>
                <RotatingText
                  texts={['developers','programmers','designers','visionaries']}
                  mainClassName="px-2 sm:px-2 md:px-3 bg-cyan-300 text-white overflow-hidden py-0.5 sm:py-1 md:py-2 justify-center rounded-lg"
                  staggerFrom={"last"}
                  initial={{ y: "100%" }}
                  animate={{ y: 0 }}
                  exit={{ y: "-120%" }}
                  staggerDuration={0.025}
                  splitLevelClassName="overflow-hidden pb-0.5 sm:pb-1 md:pb-1"
                  transition={{ type: "spring", damping: 30, stiffness: 400 }}
                  rotationInterval={2000}
                />
              </div>

              <div className="text-line">
                <span className="label">building</span>
                <RotatingText
                  texts={['crypto','AI agents','clothing line','media pod','health tech','SaaS']}
                  mainClassName="px-2 sm:px-2 md:px-3 bg-cyan-300 text-white overflow-hidden py-0.5 sm:py-1 md:py-2 justify-center rounded-lg"
                  staggerFrom={"last"}
                  initial={{ y: "100%" }}
                  animate={{ y: 0 }}
                  exit={{ y: "-120%" }}
                  staggerDuration={0.025}
                  splitLevelClassName="overflow-hidden pb-0.5 sm:pb-1 md:pb-1"
                  transition={{ type: "spring", damping: 30, stiffness: 400 }}
                  rotationInterval={2500}
                />
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
